import React, { Component } from 'react'
import {
  Card,
  CardContent,
  Typography,
  CardMedia
} from '@material-ui/core'
import { connect } from 'react-redux'
import compose from 'recompose/compose'
// import image from '../assets/modelX.png'
import modelX from '../assets/modelX.png'
import modelS from '../assets/modelS.png'
import modelY from '../assets/modelY.png'
import model3 from '../assets/model3.png'

class CarCard extends Component {


  componentWillReceiveProps(nextProps) {

  }

  renderPicture = (modelName) => {
    switch (modelName) {
      case 'modelX':
        return modelX;
      case 'modelS':
        return modelS;
      case 'modelY':
        return modelY;
      case 'model3':
        return model3;
      default:
        return modelS;
    }
}


  render() {
    const { title, modelName } = this.props
    return (
          <Card className="eachCarCard">
      <CardMedia
      wide
      style={{ width: "100%", height: "150px" }}
      image={this.renderPicture(modelName)}

        className="eachCarImage"
        title={title}
      />
      <CardContent>
        <Typography variant="body2" color="textSecondary" component="p">
          {title}
        </Typography>
      </CardContent>
    </Card>
    )
  }
}

